    \ = ['country_name', 'country_code'] + list(df.columns[2:])\n    ndf = df.merge(df_country,\
    \ how='inner')\n\n    dims = ('country_name', 'country_code', 'region')\n    vv\
    \ = [str(i) for i in range(1960, 2015)]\n    mdf = pd.melt(ndf, id_vars=dims +\
